import React from "react";
import "./Tittle.css"


function Tittle() {
  return(
  <div>
<h1 classNameName="Tittle"><span className='one tittle'>L</span><span className='two tittle'>a</span> <span className='three tittle'>M</span><span className='four tittle'>a</span><span className='five tittle'>m</span><span className='six tittle'>o</span><span className='one tittle'>n</span><span className='two tittle'>a</span></h1>
  </div>
  )
}
export default Tittle;
